import React from "react";
import redPic from "../../assets/img/red.png";
import bluePic from "../../assets/img/red.png";

class SelectImgs extends React.Component {
  render() {
    return (
      <>
        <div className="select-imgs mt16">
          <img src="../../assets/img/blue.png" alt="画像１" />
          <img src="../../assets/img/blue.png" alt="画像２" />
          <img src="../../assets/img/green.png" alt="画像３" />
          <img src={redPic} alt="画像４" />
        </div>
      </>
    );
  }
}

export default SelectImgs;
